  false,\n\t\"url\": null,\n\t\"notes\": \"During 1983 I surveyed St. Vincent Island
  in an effort to learn which species of fresh water fish, amphibians, reptiles, birds,
  mammals, and trees and shrubs occur on the island. Based on ray observations and
  those of previous observers, I have compiled preliminary lists of the vertebrate
  animals and woody plants known from St. Vincent Island. These lists are included
  in this report.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
